import React from 'react'

const Cell = ({cellState, cellIndex}) => {
    const retrieveCol = () => {
        console.log(Math.floor(cellIndex / 7));
    };
    if (cellState === 0) {
        return <div className='gamecell' onClick={retrieveCol}> 0</div>
    }
    if (cellState === 1) {
        return <div className='gamecell' onClick={retrieveCol}> 1</div>
    }
    if (cellState === 2) {
        return <div className='gamecell' onClick={retrieveCol}> 2</div>
    }
}

export default Cell;
